import React from "react";
import styles from "./Header.module.css";

const Header = (props) => {
    return <React.Fragment>
        <header className={styles.header} >
            <h1>Zwiggy</h1>
            
        </header>
        <div className={styles['main-image']} > 
            <img src="https://images.pexels.com/photos/3915855/pexels-photo-3915855.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1" alt="food_image" />
        </div>
    </React.Fragment>
};

export default Header;
